import React, { useState, useEffect } from "react";
import Cards from "./Cards";
import axios from "axios";
import { json } from "body-parser";

export default function Feed() {
  const [FetchResult, setFetchResult] = useState();

  useEffect(() => {
    console.log("| 55 Debug |  use Effect reload");

    axios({
      // `url` is the server URL that will be used for the request
      url: "/api/post/fetch",

      // `method` is the request method to be used when making the request
      method: "post", // default

      // `baseURL` will be prepended to `url` unless `url` is absolute.
      baseURL: "http://localhost:5000",

      // `headers` are custom headers to be sent
      headers: { "X-Requested-With": "XMLHttpRequest" },

      // `data` is the data to be sent as the request body
      data: {},
    })
      .then((result) => {
        console.log("| 29 Debug |" + JSON.stringify(result.data.result));

        // let obj = JSON.parse(result.data.result)
        // console.log("| 33 Debug |" + obj);

        // console.log(obj);
        // let arr = [];
        // for (let i in obj) {
        //   arr.push(obj[i]);
        //   console.log(i + "=  =" + arr[i]);
        // }

        setFetchResult(result.data.result);
        console.log("| 40 Debug |" + JSON.stringify(FetchResult));
      })
      .catch((error) => {
        console.log("| 47 Debug error |" + JSON.stringify(error));
      });
  }, []);

  return (
    <div>
      {JSON.stringify(FetchResult)}
      <br></br>
      {typeof FetchResult}

      {FetchResult &&
        FetchResult.map((item) => {
          return (
            <>
              <p>{item._id}</p>
              <p>{item.text}</p>
            </>
          );
        })}

      <Cards />
      <Cards />
    </div>
  );
}

